import React, { useRef, useState } from "react";
import { UploadIcon } from "./icons";
console.log("‚úÖ Dashboard.js loaded");

function Dashboard() {
  const fileInputRef = useRef(null);
  const [file, setFile] = useState(null);
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);
  const [report, setReport] = useState(null); // ‚úÖ this was missing!

  const acceptedTypes = [
    "py", "js", "ts", "java", "cpp", "cs", "go", "rs", "kt", "zip", "tar.gz",
  ];

  const handleFileChange = (e) => {
    const chosenFile = e.target.files?.[0];
    if (!chosenFile) return;

    const ext = chosenFile.name.split(".").pop()?.toLowerCase() || "";
    if (!acceptedTypes.includes(ext)) {
      setError("Unsupported file type");
      setFile(null);
      e.target.value = "";
      return;
    }

    setError("");
    setFile(chosenFile);
  };

  const handleUploadClick = () => {
    fileInputRef.current?.click();
  };

  const handleSubmit = () => {
    if (!file) return;
    console.log("Generating report‚Ä¶");
    setLoading(true);
    setReport(null);

    setTimeout(() => {
      setLoading(false);
      setReport({
        summary: "Your code passed all key checks. Good structure and readability overall.",
        suggestions: [
          "Consider adding more comments for clarity.",
          "Use consistent naming conventions across functions.",
          "Break down long functions into smaller units.",
        ],
        issues: [
          { line: 12, message: "Variable 'temp' declared but never used." },
          { line: 47, message: "Consider using 'const' instead of 'let'." },
        ],
      });
    }, 1200);
  };

  return (
    <div className="flex flex-col items-center text-center px-4 w-full max-w-md md:max-w-xl space-y-8">
      <h1 className="text-4xl md:text-5xl font-extrabold text-gray-900 drop-shadow-sm">
        Code Review Assistant
      </h1>

      <div
        onClick={handleUploadClick}
        className="flex items-center w-full bg-white/90 shadow-md rounded-xl px-4 py-4 cursor-pointer border border-gray-200 hover:border-blue-400 focus-within:ring-2 focus-within:ring-blue-300 transition duration-200"
        role="button"
        aria-label="Upload your code file"
      >
        <div className="flex items-center justify-center bg-blue-100 text-blue-600 rounded-lg w-10 h-10 mr-3">
          <UploadIcon />
        </div>
        <div className="flex-1 text-left text-gray-500 truncate">
          {file ? file.name : "Upload your code file"}
        </div>
        <input
          type="file"
          accept=".py,.js,.ts,.java,.cpp,.cs,.go,.rs,.kt,.zip,.tar.gz"
          ref={fileInputRef}
          onChange={handleFileChange}
          className="hidden"
        />
      </div>

      {error && <p className="text-red-600 text-sm">{error}</p>}

      <button
        onClick={handleSubmit}
        disabled={!file || loading}
        className={`w-72 h-14 text-lg font-semibold text-white rounded-full transition-all duration-300 focus:ring-2 focus:ring-offset-2 focus:ring-blue-400
          ${
            file && !loading
              ? "bg-gradient-to-r from-[#4EA7FF] to-[#0A4FBF] hover:brightness-110"
              : "bg-gray-400 cursor-not-allowed"
          }`}
      >
        {loading ? (
          <span className="flex items-center justify-center gap-2">
            <svg
              className="animate-spin h-5 w-5 text-white"
              xmlns="http://www.w3.org/2000/svg"
              fill="none"
              viewBox="0 0 24 24"
            >
              <circle
                className="opacity-25"
                cx="12"
                cy="12"
                r="10"
                stroke="currentColor"
                strokeWidth="4"
              ></circle>
              <path
                className="opacity-75"
                fill="currentColor"
                d="M4 12a8 8 0 018-8v4a4 4 0 00-4 4H4z"
              ></path>
            </svg>
            Generating‚Ä¶
          </span>
        ) : (
          "View Report"
        )}
      </button>

      {/* ‚úÖ This section displays after the report is generated */}
      {report && (
        <div className="mt-8 w-full bg-white/90 rounded-xl shadow-lg text-left p-6 space-y-4 border border-gray-200 animate-fadeIn">
          <h2 className="text-2xl font-semibold text-blue-600">üßæ Code Review Report</h2>
          <p className="text-gray-700">{report.summary}</p>

          <div>
            <h3 className="font-semibold text-gray-800">üí° Suggestions:</h3>
            <ul className="list-disc list-inside text-gray-600 text-sm space-y-1">
              {report.suggestions.map((s, i) => (
                <li key={i}>{s}</li>
              ))}
            </ul>
          </div>

          <div>
            <h3 className="font-semibold text-gray-800">‚ö†Ô∏è Issues:</h3>
            <ul className="list-disc list-inside text-gray-600 text-sm space-y-1">
              {report.issues.map((issue, i) => (
                <li key={i}>
                  <strong>Line {issue.line}:</strong> {issue.message}
                </li>
              ))}
            </ul>
          </div>
        </div>
      )}

      <footer className="text-sm text-white/80 mt-8">Made by Supriya</footer>
    </div>
  );
}

export default Dashboard;
